test('should Execution correctly', async function () {
  const result = BlurMarketplaceLibs.decodeEventPacked({
    log: {
      topics: ['0xf2f66294df6fae7ac681cbe2f6d91c6904485929679dce263e8f6539b7d5c559'],
      data: '',
    },
  });

  expect(result.totalVolumeEth).equal(0.1499);
  expect(result.totalRoyalFeeEth).equal(0);
});

test('should Execution721Packed correctly', async function () {
  const result = BlurMarketplaceLibs.decodeEventPacked({
    log: {
      topics: ['0x1d5e12b51dee5e4d34434576c3fb99714a85f57b0fd546ada4b0bddd736d12b2'],
      data: '0x0a9058c245116b357c0de1a4dc51c1fff1d73253eee8f326c78dc5e6d59e080b000000000000000000038c00bce5bccf9ddbf18b3c4b25b9751036eabccd1d12000000000018838370f34000b3b434f79f69b685c063860799bdc44dac7ef25e',
    },
  });

  expect(result.totalVolumeEth).equal(0.0069);
  expect(result.totalRoyalFeeEth).equal(0);
});

test('should Execution721MakerFeePacked correctly', async function () {
  const result = BlurMarketplaceLibs.decodeEventPacked({
    log: {
      topics: ['0x7dc5c0699ac8dd5250cbe368a2fc3b4a2daadb120ad07f6cccea29f83482686e'],
      data: '0x02b05e5d7b480b2a5ab5a7c82bb0e4957584c4632d1442b8e0ffc65b92cc08170000000000000000001683080c5a2c72c009252f0e7312f5a1ab87de02be6fbe00000000096e11a65ce0c0000fc3dd8c37880a297166bed57759974a157f0e740000000000000000000001f4d27c9f7bf5ca9283d41e0a2f6e992525673623fd',
    },
  });

  expect(result.totalVolumeEth).equal(0.6795);
  expect(result.totalRoyalFeeEth).equal(0.033975);
});
